function Profile(){
    // eslint-disable-next-line no-undef
    const[style,setStyle]=useState()
    return(
        <div className="container">
            <div className="left">
                <img src='data:image/jpeg;base64,' alt="" />
                <h3>Name:Rohan</h3>
                <h3>Email:Rohan@gmail.com</h3>
                <h3>Gender:Male</h3>
                <p>I am trained in java, javascript, react, html, css</p>
                <label htmlFor="">Check this for dark theme</label>
                <input type="checkbox"/>

            </div>
        </div>
    )
}

export default Profile
